import React from 'react';
import './App.css';
import Header from './Header';

function App() {
  return (
    <div className="App">
      <Header />

      {/* SOBRE MÍ */}
      <section id="about" className="about-section">
        <div className="about-box">
          <h3>Experiencia Laboral</h3>
          <p>Frontend Developer en X empresa...<br />Becaria en desarrollo web...</p>
        </div>
        <div className="about-box">
          <h3>Formación Académica</h3>
          <p>Curso Full Stack - Mimo App<br />Grado en Ingeniería X...</p>
        </div>
      </section>

      {/* PROYECTOS */}
      <section id="projects" className="projects-section">
        <div className="project-card">
          <img src="proyecto1.jpg" alt="Proyecto 1" />
          <div className="project-info">
            <h3>Portfolio Personal</h3>
            <p>Desarrollado con React, HTML y CSS.</p>
          </div>
        </div>
      </section>

      {/* HABILIDADES */}
      <section id="skills" className="skills-section">
        <div className="skills-scroll">
          <img src="html-logo.png" alt="HTML" />
          <img src="css-logo.png" alt="CSS" />
          <img src="js-logo.png" alt="JavaScript" />
          <img src="react-logo.png" alt="React" />
          {/* Puedes añadir más logos aquí */}
        </div>
      </section>
    </div>
  );
}

export default App;
